description:
Mo understands the problems of making sure your family eats well while realizing that so many of us have little time for complex cooking, and has set about creating recipes ideally suited for the time-pressured working family. As everyone is reeling from the worldwide financial breakdown, there's now an emphasis on getting back to basics and Mo provides us with recipes for good, wholesome, simple food. They're incredibly easy to follow and use the most common ingredients so there's no need to spend a fortune on exotic foodstuffs. It's all about making the most of...

